import Card from "./Card"

export default function Cards({ cards }) {
    return (
        <>
            {cards.map((card, index) => (
                <ul id="concepts">
                    <Card 
                        key={index}
                        title={card.title} 
                        description={card.description} 
                        image={card.image}/>
                </ul>
            ))}
        </>
    )
}
